畑・花壇・芝生・一般家庭・公共施設・学校・ビニールハウス等での水やりに最適です。<br>水道栓につなぐだけで外出時の水やりも安心の簡単給水。<br>通常・長時間の2モードで季節・植物にあわせて最適な水やりが可能です。<br>大型液晶パネル・操作ボタンで誰でも簡単に設定可能です。<br>幅広い設定機能で一般園芸から農家の方まで使用可能です。<br>場所を選ばないスタンド標準で装備しています。地下水栓にも対応しています。<br>今すぐ水やりボタンで設定時間以外でもすぐに水やり可能です。<br><br>●通常・長時間モード共通(水やり日):なし・1～30日おき。<br>●通常・長時間モード共通(水やり回数1日):1～4回。<br>●通常・長時間モード共通(水やり時刻設定):0～23時(1時間おき)。<br>●長時間モード通水:5・10・15・20・30・40・50・60分。<br>●長時間モード停止:5・10・15・20・30・40・50・60分。<br>●電源:DC6V単3形アルカリ電池4本。<br>●水流量毎分:3～15L(水道圧によってかわります)。<br>●適合ホース径:内径13～15mm・外径16～20mm。●本体・スタンド部:AES。<br>●ホースコネクター:ABS・PP。<table width="800" border="0" cellspacing="0" cellpadding="0">

